fa_icon.Init = function(fontsize)
	--local builder = imgui.GlyphRangesBuilder()
    --builder:AddRanges(imgui.GetIO().Fonts:GetGlyphRangesCyrillic())
    --builder:AddText([[]])
    --local range = imgui.ImVector_ImWchar()
    --builder:BuildRanges(range)
    

	--local MIN_ICON, MAX_ICON = 0xe005, 0xf8ff

    local config = imgui.ImFontConfig()
    config.MergeMode = true
    local glyph_ranges = imgui.GetIO().Fonts:GetGlyphRangesCyrillic()
    local iconRanges = imgui.new.ImWchar[3](0xe005, 0xf8ff, 0)
    imgui.GetIO().Fonts:AddFontFromFileTTF('trebucbd.ttf', fontsize or 14.0, nil, glyph_ranges)
    icon = imgui.GetIO().Fonts:AddFontFromMemoryCompressedBase85TTF(FONT_BASE85, fontsize or 14.0, config, iconRanges)

end

local function unicode_to_utf8(code)
   -- converts numeric UTF code (U+code) to UTF-8 string
   local t, h = {}, 128
   while code >= h do
      t[#t+1] = 128 + code%64
      code = math.floor(code/64)
      h = h > 32 and 32 or h/2
   end
   t[#t+1] = 256 - 2*h + code
   return string.char(unpack(t)):reverse()
end

setmetatable(fa_icon, {
	__call = function(t, v)
		if type(v) ~= 'function' then
			if (type(v) == 'string') then
				return t['ICON_'..v:upper()] or '?'
			elseif (type(v) == 'number' and v >= MIN_ICON and v <= MAX_ICON) then
				return unicode_to_utf8(v)
			end
			return '?'
		end
	end,

	__index = function(t, i)
		if type(i) == 'string' then
			if i == 'min_range' then
				return MIN_ICON
			elseif i == 'max_range' then
				return MAX_ICON
			end
		end

		return t[i]
	end
})

return fa_icon	